import React, { Component } from 'react';
import { Text, ScrollView, Button, StyleSheet } from 'react-native';

class HomeScreen extends Component {
  // Button/Text box to add a post

  render() {
    if (this.state.isLoading) {
      return (
        <View
          style={{
            flex: 1,
            flexDirection: 'column',
            justifyContent: 'center',
            alignItems: 'center',
          }}
        >
          <Text>Loading..</Text>
        </View>
      );
    } else {
      return (
        <View style={styles.container1}>
          <Image style={styles.logo} source={{ uri: this.state.photo }} />

          <Text>{this.state.userData.first_name}</Text>
          <Text>{this.state.userData.last_name}</Text>

          <Text>{this.state.userData.email}</Text>

          <Button
            title="Log Out"
            onPress={() => this.props.navigation.navigate('Logout')}
          />
          <Button
            title="Edit Profile"
            onPress={() => this.props.navigation.navigate('Edit')}
          />
          <Button
            title="Friends"
            onPress={() => this.props.navigation.navigate('Friends')}
          />
        </View>
      );
    }
  }
}

const styles = StyleSheet.create({
  container1: {
    flex: 1,
    flexDirection: 'column',
    justifyContent: 'space-evenly',
    alignItems: 'center',
    padding: 10,
  },
  logo: {
    width: 200,
    height: 200,
  },
});
export default HomeScreen;
